import { MdLocalPizza as icon } from 'react-icons/md';
import PriceInput from '../components/PriceInput';

export default {
    //name in code
    name: 'pizza',
    //visible title
    title: 'Pizzas', 
    type: 'document',
    icon: icon,
    fields: [
        {
            name: 'name',
            title: 'Pizza Name',
            type: 'string',
            description: 'Name of the Pizza',
        },
        {
            name: 'slug',
            title: 'Slug',
            type: 'slug',
            options: {
                source: 'name',
                maxLength: 100,
            },
        },
        {
            name: 'image',
            title: 'Image',
            type: 'image',
            options: {
                hotspot: true, 
            },
        },
        {
            name: 'price',
            title: 'Price',
            type: 'number',
            description: 'Price of the pizza in cents',
            validation: Rule => Rule.min(1000), //minimum price ten dollars
            //TODO add custom input component 
            inputComponent: PriceInput,
        }, 
        {
            name: 'toppings',
            title: 'Toppings',
            type: 'array',
            of: [{
                type: 'reference',
                to:  [{
                    type: 'topping',

                }]
            }],
        },
    ],
    preview:  {
        select: {
            title: 'name',
            media: 'image',
            topping0: 'toppings.0.name',
            topping1: 'toppings.1.name',
            topping2: 'toppings.2.name',
            topping3: 'toppings.3.name',
        },
        prepare: ({title, media, ...toppings}) => {
             //1. filter out undefined toppings
             const tops = Object.values(toppings).filter(Boolean);
             //2. return preview object for pizza

             return {
                title,
                media,
                subtitle: tops.join(', '),
             };
        },
    },
}

